  faCompass,
  faCheckCircle,
  faUser,
  faBell,
  faPaperPlane,
  faChartPie,
  faCog
} from "@fortawesome/free-solid-svg-icons";

const pic2 = require("./img/pic2.jpg");
const pic3 = require("./img/pic3.JPG");
