const profilePic = require("./img/pic1.jpg");

class App extends Component {
  constructor() {
    super();
    this.state = {
      fakedata: {
        userDetails: {
          name: "Aijaz Ali Shah",
          picture: profilePic,
          address: "Karachi, PAK",
          noOfPosts: "100",
          noOfFollowers: "102m",
          noOfFollowing: "105m",
          details:
            "Asjhdas djsda sksad ajshdjhasd ajsdhjhasd asdjhajshd ajshdjasdgsagdkhsagd mashdgksa ahsgdags",
          profession: ""
        },

        pics: [
          {
            id:"1", 
